import React from "react";
import { render } from "react-dom";
import "./footer.css";

const Footer = () => (
  <footer className="footer" style={{ marginTop: "70px" }}>
    <h1>Hi guys!</h1>
  </footer>
);

const App = () => (
  <div className="content">
    <h1>Hi guys!</h1>
  </div>
);

render([<App key="1" />, <Footer key="2" />], document.getElementById("root"));

export default Footer;
